window.trackUserAction=(t,e,a)=>{fetch(a,{method:"post",body:JSON.stringify({event:t,extra_data:e}),headers:{Accept:"application/json","Content-Type":"application/json"}})};window.documentReady=t=>{document.readyState!=="loading"?t():document.addEventListener("DOMContentLoaded",t)};documentReady(function(){let t=document.querySelector("body");t.hasAttribute("data-track-event")&&trackUserAction(t.getAttribute("data-track-event"),JSON.parse(t.getAttribute("data-track-extra")),t.getAttribute("data-track-route"))});
